const NFLPlayer = ({ nflPlayer }) => {
  return (
    <table>
      <tbody></tbody>
        {
         Object.keys(nflPlayer).map((key) => {
           return (
            <p key={key}>
              {nflPlayer[key]}
            </p>
           )
         })
       }
    </table>
  )
}

export default NFLPlayer
